interface Option {
    id: string;
    name: string;
  }
  
interface Menu {
    name: string;
    options: Option[];
} 

const menuOptions = [
    {            
        name: 'Process',
        options: [
            {
                id: '21331232',
                name: 'Compras'
            },
            {
                id: '21231232',
                name: 'Financeiro'
            },
            {
                id: '21431232',
                name: 'Marketing'
            },
            {
                id: '21412323',
                name: 'Comercial'
            },
            {
                id: '21512323',
                name: 'Jurídico'
            },
        ]
    }
  ]

const MenuOptions = () => {
    const listItensMenu = menuOptions.map((el: Menu) => {

        return (
            <li className="flex flex-col text-white text-sm">
            <span className="cursor-pointer font-semibold">{el.name}</span>
            
            <ul className="flex flex-col list-none font-normal text-xs pl-3">
                { el.options.map((el) => <li className="cursor-pointer" id={el.id}>{el.name}</li>) }
            </ul>
        </li>
        )
    })

    return (
        <>{listItensMenu}</>
    )
}

export const MenuDash = () => {
    return (
        <div className="flex flex-col bg-blue-950 p-4">
            <ul className="flex flex-col list-none">
                <MenuOptions />
            </ul>
        </div>
    )
}
